import React from "react"
import NINE from "../nl_logo.png";
import {BrowserRouter,Link} from "react-router-dom";


class Managerheader1 extends React.Component {



     onLogoutClic(){
        localStorage.clear();
        window.location="/login"
    }
    render() {

        function onItemClick(){
            window.location="/manager"
        }


        return (
            <BrowserRouter>
            <header>
                <div>
                    <nav>
                        <div className="">
                        <Link onClick={onItemClick} > <img   src={NINE} alt="nineleaps"/> </Link>

                        <Link onClick={onItemClick}>  Profile</Link>

                           <Link onClick={this.onItemClic}>  Logout</Link>

                        </div>

                    </nav>

                </div>
            </header>
            </BrowserRouter>

        )
    }
}
export default Managerheader1
